import React from 'react';
import ReactDOM from 'react-dom';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { SocialIcon } from 'react-social-icons';
import Sweetalert from 'react-bootstrap-sweetalert';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab'
import axios from 'axios';
import Header from './Components/Header';
import Footer from './Components/Footer';
import queryString from 'query-string';
import SingleEventDisplay from './SingleEventDisplay';
import PastEventDisplay from './PastEventDisplay';

class Login extends React.Component {

    constructor(props) {
        super(props);

    }

    render() {
      const styleTableDiv = {
          marginTop : '15vh',
          marginBottom : '15vh',
          background : "#eeeeee"
      }
      
        return (
            <Container>
                <Header />
                  <div style = {styleTableDiv}>
                    <Tabs defaultActiveKey = "events">
                        <Tab eventKey="upcomingEvents" title="Upcoming Events">
                            <Row style ={{margin: "0"}}>
                              <Col>
                                <center>
                                  <h4 style = {{color: "white"}}>
                                    Upcoming Events
                                  </h4>
                                </center>
                              </Col>
                            </Row>
                            <Row style ={{padding: "1rem", margin: "0"}}>
                                <Col>
                                  <SingleEventDisplay/>
                                </Col>
                            </Row>
                        </Tab>
                        <Tab eventKey = "pastEvents" title="Past Events">
                            <Row style ={{margin: "0"}}>
                              <Col>
                                <center>
                                  <h4 style = {{color: "white"}}>
                                    Past Events
                                  </h4>
                                </center>
                              </Col>
                            </Row>
                            <Row style ={{padding: "1rem", margin: "0"}}>
                                <Col>
                                  <PastEventDisplay/>
                                </Col>
                            </Row>
                          </Tab>
                    </Tabs>
                  </div>
                <Footer />
            </Container>
        )
    }
}

export default Login;
